import imageData from "../data/imageData";
import StoryProps from "./StoryProps";

function Story(){
    return(
        <div class="story">
        {imageData.map((info) => (<StoryProps
            url={info.url}
            user={info.user}
            userSub={info.user} />))}
        </div>
    )
}

export default Story;
